      "description": "<p>Position: Investment Trainee, Public Equity (12 Months)</p>\n<p>Department: Public Equity</p>\n<p>Reporting to Head of Research, Public Equity</p>\n<p><br></p>\n<p><strong>About Us</strong></p>\n<p>Founded in Singapore, SeaTown is a leading Asia-focused alternative investment firm with deep expertise across private and public markets.</p>\n<p><br></p>\n<p>Owned by Seviora, Temasek’s asset management group, we are a trusted steward of capital, investing alongside our investors in conviction-driven strategies. We strive to deliver compelling risk-adjusted returns by leveraging our extensive relationship network, decades of investing experience and astute global perspectives.</p>\n<p>For more information on SeaTown, please visit: <a href=\"https://www.seatowninternational.com/\">https://www.seatowninternational.com/</a>.</p>\n<p><br></p>\n<p><strong>Job Summary:</strong></p>\n<p>We are seeking a highly motivated Investment Trainee to join our Public Equity team. In this role, you will assist with end-to-end investment projects: from performing industry and company analysis, crafting investment theses to monitoring investment positions. You will predominantly support the Head of Research but will also collaborate with the fundamental research team and the portfolio managers. You will have the opportunity to engage external stakeholders, including investee company executives and sell-side research providers.</p>\n<p><br></p>\n<p>The ideal candidate will possess strong analytical capabilities, meticulous attention to detail, excellent communication skills, and a genuine interest in public equity investing. You should be able to work independently and as part of a team in a fast-paced, intellectually rigorous environment over the course of a 12-month traineeship.</p>\n<p><br></p>\n<p><strong>Responsibilities:</strong></p>\n<p>The trainee will support the Head of Research in several areas:</p>\n<p>· Generating ideas and maintaining research coverage in APAC &amp; global financial sector</p>\n<p>· Overall management of macro research and public equity research team</p>\n<p>· Provide support to other sector analysts or portfolio managers when required</p>\n<p><br></p>\n<p><strong>Learning objectives:<br>\n </strong>Over 12 months, the trainee will be exposed to various aspects of investment process ranging from:</p>\n<p>· Performing in-depth fundamental research on industry and companies primarily in banking and financial services sector, with learning exposure in macro as well as other industries</p>\n<p>· Ability to engage and communicate with key external stakeholders such as investee company executives, industry experts and sell-side analysts</p>\n<p>· Developing and presenting investment ideas</p>\n<p>· Observing and contributing to the workings of both research process and portfolio management</p>\n<p><br></p>\n<p><strong>Qualifications &amp; Skills:</strong></p>\n<p>· Excellent analytical skills, ability to work independently and collectively as part of a team</p>\n<p>· Good communication skills, both verbal and written, Conversant in MS Office</p>\n<p>· Interest in investing, strong desire to learn and hardworking</p>\n<p><br></p>\n<p>Please submit your application to <u>Careers@seatownholdings.com</u> with your updated CV.</p>\n<p><br></p>\n<p>Due to the high volume of application, we seek your understanding that only shortlisted candidates will be contacted. Many thanks for your interest and time.</p>",
