        "vision": "<p><strong>The Innovative Polytechnic</strong><br /><strong>A Nexus of Future-ready People, Learners & Industry</strong></p>",
        "aboutUs": "<p>Nanyang Polytechnic (NYP) is a premier tertiary institution dedicated to meeting the manpower needs of Singapore and aspirations of our students in a constantly changing world.&nbsp; We work closely with industry partners to continually develop new capabilities.&nbsp; NYP has seven schools offering a wide range of diploma courses in Engineering, Information Technology, Business Management, Health Sciences, Chemical &amp; Life Sciences, Design, and Interactive Digital Media. We also offer a wide selection of continuing education and training programmes to adult learners, at advanced diploma, specialist diploma, diploma and certificate levels as well as customised professional development programmes.&nbsp; Our modern campus is fully equipped with state-of-the-art facilities.&nbsp; In NYP, people development is key and geared towards meeting the aspirations of our people.</p>\r\n",
